import React from 'react';
import logo from './googlelogo_color.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <main>
        <img src={logo} className="App-logo"
        alt="logo" />
      </main>
    </div>
  );
}

export default App;
